import { Routes, Route } from 'react-router-dom';

import HomePage from './pages/homepage.page';
const HatsPage = () => (
  <div>
    <h1>HATS PAGE </h1>
  </div>
);

function App() {
  return (
    <div className='w-full h-screen font-noto-sans'>
      <Routes>
        <Route path='' element={<HomePage />} />
      </Routes>
    </div>
  );
}

export default App;
